description:
Tvrip van Wim Helsen - Het uur van de prutser (11 dec. 2010, Ned. 3)

Afspelen met VLC; klik op Video--Deinterlace--Lineair

Sorry voor de blokjes die soms in beeld verschijnen, een fout bij het opnemen...


--------------------------------------------------------

&quot;Helaholahelaholahelaholahelahola jongens en meisjes!
Ik heb een vraag aan jullie: Hoe goed kan een sfeer zijn?&quot;

&quot;Eeuh... Als ik hier de sfeer eens goed bekijk...&quot;

&quot;Super goed!&quot; roept er iemand spontaan. 

&quot;Correct!&quot;, zegt de quizmaster, &quot;U hebt een paard gewonnen. Het heet Bella de Koe, maar het is een paard!&quot;

